  [],\n\t\"num_tags\": 0,\n\t\"name\": \"afsc-race-sap-detailed-crab-data-from-noaa-fisheries-service-2012-chukchi-sea-bottom-trawl-sur\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains detailed crab data
  collected from the 2012 NOAA/NMFS/AFSC/RACE crab-groundfish bottom trawl survey
  of the Chukchi Sea. 71 survey stations were successfully completed during the bottom
  trawl survey. The survey area extended north and east from the Bering Strait to
  Barrow Canyon, bounded to the west by the U.S.-Russia Maritime Boundary and east
  to the 10-m bathymetry limit along the Alaska coastline. Demersal populations were
  sampled by trawling at stations centered within 55.56 x 55.56 km (30 x 30 nautical
  miles) grid cells covering the survey area. 100% of the catch is sorted for commercially
  important crab species. Crabs are sorted by species and sex, and a sample is measured
  to the nearest millimeter to provide a size-frequency distribution (see note under
  use constraints for analyzing catches where crab were subsampled for measurement).
  Carapace width is measured for Tanner crabs, and carapace length is measured for
  king and hair crabs.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
