  \"progress\",\n\t\t\"value\": \"completed\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\":
  \"[\"Access Constraints: There are no legal restrictions on access to the data.
  They reside in public domain and can be freely distributed. | Use Constraints: Population
  size estimates make the assumption that 100% of the species within the path of the
  trawl are captured. In fact, the situation is more complex. As with any fishing
  gear, the survey trawl exhibits some size selectivity. Some crab may escape under
  the footrope of the net. Survey abundance estimates are probably best seen as relative
  measures of abundance. This survey was designed as a systematic survey based on
  a 55.6 km (30 nautical mile (nmi)) square grid pattern with the nplanned trawl stations
  located at the approximate center of each grid cell. Any data analysis must take
  into consideration the survey design for the results to be valid. This dataset includes
  data obtained from non-standard (special project, beam trawl,opportunistic collections,
  etc.) tows, and data that may have been collected from poor performance tows.   Note
  that, while 100% of the total catch is sorted for all commercially important crab
  species, it may not be possible to measure all crabs. This is noted in the SAMPLING_FACTOR
  data field: a sampling factor of 1 indicates that all crab were measured; a sampling
  factor > 1 indicates that crabs were subsampled for measurement. To calculate the
  total number of crab caught by haul, sum the sampling_factor. This database should
  not be copied or distributed without its associated metadata file. User must read
  and fully comprehend the metadata prior to use. Use of these data is not restricted;
  however, organizations, agencies, units of government, or other users are responsible
  for the appropriate application of these data. Acknowledgement of NOAA/NMFS/AFSC
  ,as the source from which these data were obtained, in any publications and/or other
  representations of these data is suggested. | Distribution Liability: The user is
  responsible for the results of any application of this data for other than its intended
  purpose.NOAA denies liability if the data are misused.\"]\"\n\t},\n\t{\n\t\t\"key\":
